import "./ExpenseItem.css"

function ExpenseItem() {
    const date = new Date(2022,2,10);
    const expanseTitle = "Car Insurance";
    const expansePrice = 297.64;
  return (
    <div className="expanse-item">
      <div>{date.toLocaleDateString()}</div>
      <div className="expanse-item__description">
          <h2>{expanseTitle}</h2>
          <div className="expanse-item__price">${expansePrice}</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
